import React from 'react';
import { Outlet } from 'react-router-dom';
import DeviceList from '../DeviceDetails/DeviceList';

const MainPage = () => {
  return (
    <div>
      <h1>MaaS360 Dashboard</h1>
      <button>Logout</button>
      <DeviceList />
      <Outlet />
    </div>
  );
};

export default MainPage;
